import React from "react";
import "./comment-section.scss";

const CommentSection = ({ name, comment, postedTime }) => (
  <div className="comment">
    <h3>{name}</h3>
    <p>{comment.comment}</p>
    <p>{postedTime.postedTime}</p>
  </div>
);

export default CommentSection;
